import React, { Component } from 'react';
import './css/login.css';

class Popup extends React.Component {

  //Login
  Login = () =>{
    return(
      <div>
        <button>Login</button>
      </div>
    )
  }

  Dashboard = () =>{
    return(
      <div>
        <h1>Dashboard</h1>
        <button>Logout</button>
      </div>
    )
  }

